import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import leftAngle from '../icons/angle-left.svg';
import rightAngle from '../icons/angle-right.svg';
import '../index.scss';

class Work extends Component {
  render() {
    return (
      <div>
        <div className="row start-xs top-xs"><img src={leftAngle} alt="angle" /></div>
        <div className="row center-xs title-section">
          <div className="col-xs-10 middle-xs"><h1 className="title-section-style">stephen hathaway is a product designer in denver, currently sr. experience designer at slalom.</h1></div>
        </div>
        <div className="row start-xs botton-xs"><img src={rightAngle} alt="angle" /></div>
          <div>
            <ul>
              <li><Link to="work/work-sample">Sample Work</Link></li>
            </ul>
        </div>
      </div>

    );
  }
}

export default Work;
